const Shoes = (props) => {
    return(
        <div className="w-[94%] m-auto grid max-w-7xl md:grid-cols-4 grid-cols-2 gap-10 mt-[17%] mb-[2%]">
             <img className="cursor-pointer " src="/images/shoeOne.png" alt="" />
             <img className="cursor-pointer " src="/images/shoeTwo.png" alt="" />
             <img className="cursor-pointer " src="/images/shoeThree.png" alt="" />
             <img className="cursor-pointer " src="/images/shoeFour.png" alt="" />
        </div>
    )
}

export default Shoes;
